class Solution:
    def maxNumberOfApples(self, weight: List[int]) -> int:
        weight.sort()
        baskets = [0]*5001
        for i, x in enumerate(weight):
            for j in range(5001):
                if j + x <= 5000 and baskets[j] == 0:
                    baskets[j+x] = 1
        return sum(1 for x in baskets if x == 1)
